                WriteLiteral(@"      </section><!-- End Why Us Section -->
        <!-- ======= About Section ======= -->
        <section id=""about"" class=""about"">
            <div class=""container-fluid"">

                <div class=""row"">
                    <div class=""col-xl-5 col-lg-6 video-box d-flex justify-content-center align-items-stretch"">
