                    <div class=""col-xl-7 col-lg-6 icon-boxes d-flex flex-column align-items-stretch justify-content-center py-5 px-lg-5"">
                        <h3>Minha história</h3>
                        <p>
                            <b>Jay Soares é nascida no bairro do Belenzinho em São Paulo</b>, de família nordestina e casada. Sonhava em se formar em
                            fisioterapia, logo que terminou o ensino médio, mas infelizmente após 2 anos de curso, esse sonho foi interrompid");
                WriteLiteral(@"o por
                            problemas de saúde na família e trancou a faculdade. A vontade de estudar e trabalhar nunca foi impossível. Trabalhou
                            como recepcionista, promotora de vendas, atendente de loja, caixa, assistente de escritório e analista de logística, mas
                            sempre investindo o pouco que ganhava em cursos pré vestibular, inglês e informática. Em 2009 conseguiu passar no pré
                            requisito de bolsa do ENEM e começou a estudar Relações Públicas, que em 2011 foi novamente interrompida pela própria
                            faculdade (baixa procura pelo curso), mais uma vez outro sonho de concluir o ensino superior impedido de ser concluído,
                            porém para não perder a bolsa de estudos, resolveu fazer o Curso de Tecnologia em Logística e se formou em 2012. Mesmo
                            atuando a mais de 6 anos na área de Logística, que ajudou muito em suas conquistas pessoais, não traz");
                WriteLiteral(@"ia a felicidade em
                            realizar o que se amava. Em 2017 realizou um curso de Reiki, onde houve algum despertar em busca da realização
                            profissional e pessoal, então resolveu começar o <b>Curso de graduação em estética</b>, claro, como uma Escorpiana legítima
                            não poderia ser um simples “cursinho” de Estética. E o período do Curso de Estética foi uma fase muito desafiadora,
                            com doença grave, crises existenciais e financeiras, mas nunca houve o desejo em desistir do sonho em fazer a missão em
                            poder cuidar do próximo, a levar saúde e Bem Estar, amor, ética e respeito. <strong>
                                Formada em Estética e Cosmetologia pela
                                Universidade Nove de Julho em 2019, também é habilitada em atuar em Pré e Pós Operatório em Cirurgias Plásticas com
                                ênfase em Drenagem Linfática e Eletroterapia
   ");
                WriteLiteral(@"                         </strong>, Mestra em Reiki, possui cursos para que atuam nas tratativas de
